// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/* Inheritance tree
   A
 /  \
B   C
 \ /
  D
*/

contract A {
    // This is called an event. You can emit events from your function
    // and they are logged into the transaction log.
    // In our case, this will be useful for tracing function calls.
    event Log(string message);

    function foo() public view virtual returns (string memory) {
        return "a.foo";
    }

    function bar() public view virtual returns (string memory) {
        return "a.bar";
    }
}

contract B is A {
    function foo() public view virtual override returns (string memory) {
        return A.foo();
    }

    function bar() public view virtual override returns (string memory) {
        return super.bar();
    }
}

contract C is A {
    function foo() public view virtual override returns (string memory) {
        return A.foo();
    }

    function bar() public view virtual override returns (string memory) {
        return super.bar();
    }
}

contract D is B, C {
    // Try:
    // - Call D.foo and check the transaction logs.
    //   Although D inherits A, B and C, it only called C and then A.
    // - Call D.bar and check the transaction logs
    //   D called C, then B, and finally A.
    //   Although super was called twice (by B and C) it only called A once.

    function foo() public view override(B, C) returns (string memory) {
        return super.foo();
    }

    function bar() public view override(B, C) returns (string memory) {
        return super.bar();
    }
}
